import React from "react";
import logo from "./logo.svg";
import "./App.css";
import { Router, Route, NavLink, Link, Redirect } from "react-router-dom";
import PokeDash from "./components/PokeDash";
function App() {
  return (
    <div className="App">
      <Router>
        <Route />
        <Route path="/" component={PokeDash} />
      </Router>
    </div>
  );
}

export default App;
